import React, { useState } from "react";
import Blogcss from "./BlogPreview.module.css";
import Slide from "../../component/Slide";
const BlogPreview = () => {
  return (
    <div className={Blogcss.container}>
      <div className={Blogcss.wrapper}>
        <Slide one={true}></Slide>
        <div className={Blogcss.titles}>
      <div className={Blogcss.title}>CHECK OUT</div>
         <div className={Blogcss.title}>OUR BLOGS</div>
        </div>

        <Slide one={false}></Slide>
      </div>
    </div>
  );
};

export default BlogPreview;
